; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 768 &lt;/li&gt;\n          &lt;li&gt; Memory: 5.40 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1164","type":"CategoricalTicker"},{"attributes":{},"id":"1267","type":"ResetTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1110"},"glyph":{"id":"1132"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1134"},"nonselection_glyph":null,"view":{"id":"1136"}},"id":"1135","type":"GlyphRenderer"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{},"id":"1525","type":"Selection"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"CategoricalAxis"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{},"id":"1492","type":"BasicTickFormatter"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1103","type":"Quad"},{"attributes":{"start":0},"id":"1372","type":"DataRange1d"},{"attributes":{},"id":"1485","type":"AllLabels"},{"attributes":{"overlay":{"id":"1096"}},"id":"1093","type":"BoxZoomTool"},{"attributes":{"coordinates":null,"formatter":{"id":"1435"},"group":null,"major_label_policy":{"id":"1436"},"ticker":{"id":"1089"},"visible":false},"id":"1088","type":"LinearAxis"},{"attributes":{},"id":"1082","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"13
